import NewTwist from "../../components/Home/Twist/NewTist";
import ListTwist from "../../components/Home/Twist/ListTwist";
import { Routes, Route } from "react-router-dom";
import Profile from "../../components/Home/Profile/Profile";
const HomeRoutes = ({ addTwist, twists }) => {
  return (
    <Routes>
      <Route
        path="/"
        element={
          <>
            <NewTwist addTwist={addTwist}></NewTwist>
            <ListTwist twists={twists}></ListTwist>
          </>
        }
      ></Route>
      <Route path="/profil" element={<Profile />}></Route>
    </Routes>
  );
};

export default HomeRoutes;
